import React from 'react';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      {/* Left: Logo */}
      <div className="navbar-left">
        <h2 className="logo">
          fiverr<span className="dot">.</span>
        </h2>
      </div>

      {/* Right Content: Center links + Auth buttons */}
      <div className="navbar-right-group">
        {/* Middle: Navigation Links moved right */}
        <ul className="navbar-center">
          <li><a href="#">Fiverr Pro ‚ñæ</a></li>
          <li><a href="#">Explore ‚ñæ</a></li>
          <li><a href="#">üåê EN</a></li>
        </ul>

        {/* Auth Buttons */}
        <div className="navbar-right">
          <a href="#" className="login-btn">Login</a>
          <a href="#" className="join-btn">Signup</a>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
